import React from "react";
import _ from "lodash";
import { Button } from '@material-ui/core';
import LogoTextBox from './LogoTextBox.js';
import LogoImage from './LogoImage.js';
import * as html2Canvas from 'html2canvas';
import CloudDownloadIcon from '@material-ui/icons/CloudDownload';
import AddBoxIcon from '@material-ui/icons/AddBox';
import ImageIcon from '@material-ui/icons/Image';
import download from 'downloadjs';

export default class LogoCanvas extends React.PureComponent {
  
	constructor(props) {
	  super(props);
  
	  this.state = {
		listOfLogoTextBox : ["textBox1", "textBox2", "textBox3"],
		listofLogoImage : ["image1", "image2", "image3"],
		xCoord : "10",
		yCoord : "10",
		width : "300",
		height : "600",
		textBoxListStyle : {
			"textBox1" :{
			  text: "textBox1",
			  color: "#FF0000",
			  fontSize: "12pt",
			  backgroundColor: "#00FFFF", 
			  borderRadius: "10pt", 
			  borderColor: "#FFFF00",
			  borderWidth: "10pt",
			  borderStyle: "solid",
			  padding: "4pt",
			  margin: "3pt",
			  xCoord: 0,
			  yCoord: 0
			},
			"textBox2" :{
			  text: "textBox2",
			  color: "#FF0000",
			  fontSize: "12pt",
			  backgroundColor: "#00FFFF", 
			  borderRadius: "10pt", 
			  borderColor: "#FFFF00",
			  borderWidth: "10pt",
			  borderStyle: "solid",
			  padding: "4pt",
			  margin: "3pt",
			  xCoord: 50,
			  yCoord: 40
			},
			"textBox3" :{
			  text: "textBox3",
			  color: "#FF0000",
			  fontSize: "12pt",
			  backgroundColor: "#00FFFF", 
			  borderRadius: "10pt", 
			  borderColor: "#FFFF00",
			  borderWidth: "10pt",
			  borderStyle: "solid",
			  padding: "4pt",
			  margin: "3pt",
			  xCoord: 300,
			  yCoord: 300
			},
			"addingTextBox" :{
				text: "Example Text",
				color: "#FF0000",
				fontSize: "12pt",
				backgroundColor: "#00FFFF", 
				borderRadius: "10pt", 
				borderColor: "#FFFF00",
				borderWidth: "10pt",
				borderStyle: "solid",
				padding: "4pt",
				margin: "3pt",
				xCoord: 350,
				yCoord: 350
			  },
		},
		imageListStyle : {
			"image1" : {
			  source : "data:image/jpeg;base64,",
			  xCoord : 400,
			  yCoord : 400,
			},
			"image2" : {
			  source : "data:image/jpeg;base64,",
			  xCoord : 200,
			  yCoord : 200,
			},
			"image3" : {
				source : "data:image/jpeg;base64,",
				xCoord : 100,
				yCoord : 100,
			}
		}
	  };

	}

	createTextBox(textBoxElement){
		return(
			<div>
				<LogoTextBox style = {this.state.textBoxListStyle[textBoxElement]} />
			</div>
		)
		
	}

	createImage(imageElement){
		return(
			<div>
				<LogoImage style = {this.state.imageListStyle[imageElement]} />
			</div>
		)
		
	}

	downloadImage() {
		html2Canvas(document.getElementById("logoCanvasImageZone")).then(function(canvas)  {  
			download(canvas.toDataURL("image/png"), "gologoloLogo.png");
		  });
	}

	// TODO: Make functions to remove items from list and call setState to re-render. Also remember to update the server with this info.

	addTextBox = () => {
		this.setState({
			listOfLogoTextBox: this.state.listOfLogoTextBox.concat("addingTextBox")
		  });
	}

	addImage() {
		console.log("addImage function");
	}

	render() {
		return(
			<div id = "logoCanvasMain">
				<Button variant = "outlined" onClick = {this.addTextBox} id = "addTextBoxButton" startIcon = { <AddBoxIcon/> }>Add Text Box</Button>
				<Button variant = "outlined" onClick = {this.addImage} id = "addImageButton" startIcon = { <ImageIcon/> }>Add Image</Button>
				<Button variant = "outlined" onClick = {this.downloadImage} id = "downloadLogoButton" startIcon = { <CloudDownloadIcon/> }>Download Logo as Image</Button>
				<div id = "logoCanvasImageZone">
				{_.map(this.state.listOfLogoTextBox, textBoxElement => this.createTextBox(textBoxElement))}
				{_.map(this.state.listofLogoImage, imageElement => this.createImage(imageElement))}
				</div>
			</div>
		) 
	} // IDEA: Might need to add z-coord to LogoTextBox and LogoImage so they can be moved forwards and backwards
	  // TODO: Need to add some sort of selector and button to trigger z-coord change
	
  
	
  }